        /// <summary>
        /// Apply the virtualizer on the <see cref="AudioListener3D"/>'s output, if the configuration matches the virtualization layout and filter sample rate.
        /// </summary>
        public static void Process(float[] Output) {
            int ChannelCount = AudioListener3D.ChannelCount, UpdateRate = AudioListener3D.Current.UpdateRate;
            if (ChannelCount != 8 || AudioListener3D.Current.SampleRate != 48000) // TODO: check if the configuration is a 5.1.2 layout
                return;
            if (L == null) {
                L = new Convolver(Left);
                R = new Convolver(Right);
                C = new Convolver(Center);
                RL = new Convolver(RearLeft);
                RR = new Convolver(RearRight);
                TL = new Convolver(TopLeft);
                TR = new Convolver(TopRight);
            }
            float[][] ChannelSplit = new float[ChannelCount][];
            for (int Channel = 0; Channel < ChannelCount; ++Channel)
                ChannelSplit[Channel] = new float[UpdateRate];
            int OutputSample = 0;
            for (int Sample = 0; Sample < UpdateRate; ++Sample)
                for (int Channel = 0; Channel < ChannelCount; ++Channel)
                    ChannelSplit[Channel][Sample] = Output[OutputSample++];
            // TODO: don't touch anything below 120 Hz, uncomment filters when the convolver is fully optimized
            //L.Process(ChannelSplit[0]);
            //R.Process(ChannelSplit[1]);
            //C.Process(ChannelSplit[2]);
            //RL.Process(ChannelSplit[4]);
            //RR.Process(ChannelSplit[5]);
            //TL.Process(ChannelSplit[6]);
            //TR.Process(ChannelSplit[7]);
            OutputSample = 0;
            for (int Sample = 0; Sample < UpdateRate; ++Sample)
                for (int Channel = 0; Channel < ChannelCount; ++Channel)
                    Output[OutputSample++] = ChannelSplit[Channel][Sample];
        }
